import Header from "../comp/Header";
import Footer from "../comp/Footer";


 const portfilo = ()=>{
  return (
    <>
    <Header />
    <main>
      <h2>name:</h2>
      <h2>email:</h2>
      <h2>DATE DE  CREATION DE COMPTE :</h2>
    </main>
    <Footer />
    </>
    );
};



export default portfilo;
